import React from 'react';

class Pokedex extends React.Component {

  render() {
    const { pokemons } = this.props;
    const pokeCard = pokemons.map((pokemon) => <Pokedex key= { pokemons.id } pokemon= { pokemon } />);
    return (
      <section>
      {pokeCard}
      </section>
    );
  }

}

export default Pokedex;
